    /**
     * 76. 最小覆盖子串
     * 给你一个字符串 S、一个字符串 T，请在字符串 S 里面找出：包含 T 所有字符的最小子串。
     *
     * 示例：
     *
     * 输入: S = "ADOBECODEBANC", T = "ABC"
     * 输出: "BANC"
     * 说明：
     *
     * 如果 S 中不存这样的子串，则返回空字符串 ""。
     * 如果 S 中存在这样的子串，我们保证它是唯一的答案。
     */
    public String minWindow(String s, String t) {
        //初始化窗口windows和 所需字符needs
        HashMap<Character, Long> needs = new HashMap<Character, Long>();
        HashMap<Character, Long> windows = new HashMap<Character, Long>();

        for (int i=0; i<t.length(); i++) {
            if (needs.containsKey(t.charAt(i))) {
                needs.put(t.charAt(i), needs.get(t.charAt(i)) + 1);
            } else {
                needs.put(t.charAt(i),1L);
                windows.put(t.charAt(i),0L);
            }
        }
        int left = 0;
        int right = 0;
        int val = 0;
        int start = 0;
        int len = Integer.MAX_VALUE; //更新最小覆盖子串的长度
        while (right < s.length()) {
            char r = s.charAt(right);
            //如果该字符串在need里，更新窗口windows的值
            if (needs.containsKey(r)) {
                windows.put(r, windows.get(r) + 1);
                if (windows.get(r).equals(needs.get(r))) {
                    val ++;
                }
            }
            right ++;
            while ( val == needs.size()) {  //当右移到满足条件，开始左移
                //更新最小覆盖子串
                if (right-left < len) {
                    start = left;
                    len = right - left;
                }

                if (needs.containsKey(s.charAt(left))) {
                    if (windows.get(s.charAt(left)).equals(needs.get(s.charAt(left)))) {
                        val --;
                    }
                    windows.put(s.charAt(left), windows.get(s.charAt(left)) - 1);
                }
                left ++;
            }

            //System.out.println(len);
        }

        return len == Integer.MAX_VALUE?"":s.substring(start, start+len);

    }



    public static void main(String[] args) {
        String S = "ADOBECODEBANC";
        String T = "ABC";
        Solution76 s = new Solution76();
        System.out.println(s.minWindow(S,T)); //"BANC"

        S = "";
        T = "";
        System.out.println(s.minWindow(S,T)); //"BANC"
    }
